import ResponsiveMenu from 'react-responsive-navbar';

const Navbar = (props) => {
  return (
    <ResponsiveMenu
      menuOpenButton={<div>Menu</div>}
      menuCloseButton={<div>Cerrar</div>}
      changeMenuOn='500px'
      largeMenuClassName='large-menu-classname'
      smallMenuClassName='small-menu-classname'
      menu={
        <div>
          <div className='item'>
            Logo
            <div className='opts'>Opciones</div>
          </div>

          <div className='item'>Iniciar Sesion</div>
        </div>
      }
    />
  );
};
export default Navbar;
